import React, { Component } from "react";

export default class TareasList extends Component {
  render() {
    return (
      <div>
        <p>tareas list</p>
        <ul>
          {this.props.tareas.map(tarea => {
            return <li>{tarea.id}</li>;
          })}
        </ul>
      </div>
    );
  }
}
